import {  createAsyncThunk } from '@reduxjs/toolkit';
import axios from 'axios';

export const fetchData = createAsyncThunk(
  'data/fetchData',
  async () => {
    const response = await fetch('http://34.159.231.164/geoapi/json/');
    const data = await response.json();
    return data;
  }
);
